import React from 'react';
function Card(props){
  return(
  <div className="Cards">
  <div className="Card">
  <div className="image">
   <img src={props.src}/>
  </div>
  <div className="details">
   <p>{props.tit}</p>
   <h1>{props.sname}</h1>
   <a href={props.link}>
       <button id="btn">Watch Now</button>
   </a>
   </div>
  </div>
</div>);
}
export default Card;
